function ImageLight(){
  return(
    <div className='divforImageLightMobile'>
      <img className='imageLightMobile' src={require('./images/bg-mobile-light.jpg')} alt=""/>
      <img className='imageLightMobile displayNone' src={require('./images/bg-desktop-dark.jpg')} alt=""/>
      <img className='imageLightMobile displayNone' src={require('./images/bg')} alt=""/>
      <img className='imageLightMobile displayNone' src={require('./images/bg-desktop-dark.jpg')} alt=""/>
    </div>
  )
}

